import React from 'react';



function Cards(props) {
    console.log(prop)
    return (

        <div>
            <div>Original Netflix Siries</div>
            <img src={prop.imgsrc} alt="Netflix Properties"/>
            <h3>{prop.sname}</h3>
        </div>
    );
}

export default Cards;
